                showSuccess={showSuccess}
                showWarning={showWarning}
                showInfo={showInfo}
              />
            </PopupLayout>
          </PublicLayout>
        } />
      </Routes>

      {/* Popup Routes for authenticated users */}
      {background && (
        <Routes>
          {/* Authentication routes - redirect if already authenticated */}
          <Route path="/login" element={
            <PublicRoute restricted={true}>
              <PopupLayout>
                <LoginPage
                  showError={showError}
                  showSuccess={showSuccess}
                  showWarning={showWarning}
                  showInfo={showInfo}
